king the store more vibrant. Max retails its own label of apparel for men, women and children along with footwear, accessories, cosmetics and household products.',1,NULL,1,'Kuwait','yes','Al Masjid Al Aqsa St, Bayan, Kuwait',NULL,NULL,0,1,1,'1','not_active',3,1,1,240,'2019-02-04 16:12:36','2019-04-30 17:59:13','2019-04-30 17:59:13'),(150,1,'uploads/images/expo/gUC5n78leuRRZb8eAfgDtLXPf2sfc5JdK2ErsLCT.jpeg',241,'zara','uploads/images/expo/pTMr415Fidnoj9vFSPSUP7ZqjbxuDEZfxONeHrFN.jpeg','zara',1,NULL,1,'HAWALY','no','Munther Tower, Al Kuwayt, Kuwait',NULL,NULL,0,1,1,'1','not_active',1,1,1,1,'2019-02-04 16:33:57','2019-04-30 18:15:31','2019-04-30 18:15:31'),(151,1,'uploads/images/expo/BfrTU60hrSLdv4wQhz5TDLav3qesduZuvf4bdjil.jpeg',242,'MANGO','uploads/images/expo/B1jZ590gIKXtzcBK3sPLAruMyUHUFpmmpjbY7nOf.jpeg','MANGO',1,NULL,1,'Kuwait','no',NULL,NULL,NULL,0,1,1,'1','not_active',0,0,0,242,'2019-02-04 16:36:17','2019-03-22 20:39:33',NULL),(152,2,'uploads/images/expo/Uj33oKvupI0kFHPDrcBMKG0DzBy5t2vIDhVINulI.png',243,'Nayomi','uploads/images/expo/k1nlKYCrYentahpatCyzkTM4ZTnA5Fl3z3dABmIG.png','Nayomi was founded in the Kingdom of Saudi Arabia in 1992 as a single lingerie store, and 24 years later has evolved into a distinctive, leading brand within the region. It offers a number of key lines including fashionable lingerie, luxurious nightwear, stunning bridal ensembles, unique bath wear and slippers as well as an extensive range of fragrances.\r\n\r\nNayomi, which means ‘soft and delicate’ in Arabic, uses a variety fabrics, from cotton and satin to silk and chiffon, in their designs. All the prints that are utilized are unique to Nayomi, ensuring every collection is fresh and uniquely Nayomi.\r\n\r\nLaunched in the Kingdom of Saudi Arabia, the brand now has 210 stores across the region including Qatar, Oman, Bahrain, UAE, Kuwait and Morocco.',1,NULL,1,'Kuwait','no',NULL,NULL,NULL,0,1,1,'1','active',6,0,0,1,'2019-02-04 16:39:20','2019-05-16 19:31:27',NULL),(153,1,NULL,245,'ema