INSERT INTO `settings` VALUES (1,'site_name','MY EXPO','no'),(2,'email','info@expo.com','yes'),(3,'phone','+958-56845-213','yes'),(4,'url','expo','yes'),(5,'facebook','https://www.facebook.com/Linekw/','yes'),(6,'twitter','https://www.twitter.com/linekwt/','yes'),(7,'site_address','kuwait - City - Street','yes'),(8,'site_logo','uploads/images/settings//Kjmiha8x9eLYRaIEYMnnxzB4exw4cbG1zSkvOxOW.jpeg','no'),(9,'longitude','47.90357240000003','yes'),(10,'latitude','29.352729','yes'),(11,'per_page','200','no'),(12,'privacy','12 	privacy','no'),(13,'terms','13 	terms','no'),(14,'about','14 	about','no'),(15,'office_address','402 Rimal ’ Building, Aljalaa’ st.<br>Gaza, Palestine.','no'),(16,'email_address','info@expo.com','no'),(17,'contact_information','+970 59 943 6800','no'),(18,'instagram','https://www.instegram.com/linekw','yes'),(21,'payment_subscribtion','<p>21 payment_subscribtion</p>','no'),(22,'about_ar','<p>عن التطبيق<br />\r\nتطبيق ارض المعارض اون لاين المفتوح في الكويت وبقية دول الخليج لكل قطاعات أعمال التجارة الخاصه بالأزياء وغيرها, يهدف لتسهيل الوصول للشركات في الكويت ومنتجاتها والتواصل معهم مباشره ومع أعضاء فريقهم<br />\r\nMy Expo يهدف لتسهيل معرفه الاشخاص من داخل الكويت وخارجها بالشركات العامله بالكويت<br />\r\nيمكن لاصحاب الاكسبو والبوثات تحديث واضافه منتجاتهم من خلال حساباتهم وارسال اشعارات لمستخدمي التطبيق</p>','no'),(23,'about_en','<p>About us (En) *<br />\r\nتطبيق ارض المعارض اون لاين المفتوح في الكويت وبقية دول الخليج لكل قطاعات أعمال التجارة الخاصه بالأزياء وغيرها, يهدف لتسهيل الوصول للشركات في الكويت ومنتجاتها والتواصل معهم مباشره ومع أعضاء فريقهم<br />\r\nMy Expo يهدف لتسهيل معرفه الاشخاص من داخل الكويت وخارجها بالشركات العامله بالكويت<br />\r\nيمكن لاصحاب الاكسبو والبوثات تحديث واضافه منتجاتهم من خلال حساباتهم وارسال اشعارات لمستخدمي التطبيق</p>','no'),(24,'terms_ar','<p>Term of use (Ar)<br />\r\n1. Whenever You use this website, you will be subject to the Privacy Statement in force at all times, and You should review that text in order to check that You are in agreement with it. The provision of your data is voluntary, however, please note that if You do not provide us with the required personal data, we may not be able to provide the information, products or services You need or process your request.<br />\r\n2. Personal data You provide will be kept in a file under the responsibility of ITX FASHION LIMITED (&quot;ITX&quot;) for the purposes of:<br />\r\n1. the performance and enforcement of the purchase and sale contract over the products You have purchased, or of any other contract between You and us; and<br />\r\n2. attending to Your requests.<br />\r\n3. You have the right to access and correct your personal data and request information about our data protection policies and procedures. ITX FASHION LIMITED, with registered address at Hainault House, 5th Floor, 69-71 Stephen&acute;s Green, Dublin 2, Ireland, being in charge of the file, undertakes to keep your personal information confidential and to ensure the exercise of your access, rectification, cancellation and objection rights by sending a letter to the above referred address or to the registered address of Inditex, S.A., as provided in the paragraph below or by e-mail to funcionlopd@inditex.com , for the attention of &quot;Funci&oacute;n LOPD&quot;.<br />\r\n4. To fulfill the purposes above, we are required to disclose the information that You have provided to us to other companies in the Inditex Group located in Spain (with activities, both online and in-store, related to the sectors of decoration, textiles, finished clothing products and home decoration, other complimentary sectors such as cosmetics and leather goods, as well as the development and support of e-commerce business) which ITX forms part, and Industria de Dise&ntilde;o Textil, S.A. (Inditex, S.A.), the holding company of the Inditex Group with registered address at Avenida de la Diputaci&oacute;n, Edificio Inditex, 15142 Arteixo (A Coru&ntilde;a), and we understand that by providing information in this website or otherwise to us, You expressly authorize us to disclose and process your information as described.<br />\r\n5. We also intend to use your name, email address, address or phone number to send you commercial communications (both online and in-stores) about decoration, textile, finished fashion, homeware and furniture, cosmetics, leather goods, lingerie, underwear, accessories, fragrances products and services of myexpo.shop and/ or of any other brands/companies belonging to the Inditex Group, including those with activities related to the development and support of e-commerce business. myexpo.shop may share your personal data with any other companies within the Inditex Group who provide decoration, textile, finished fashion, homeware and furniture, cosmetics, leather goods, lingerie, underwear, accessories, fragrances products and services, as well as the development and support of e-commerce business for direct marketing purposes. Your consent is<br />\r\nrequired before we do so. You can withdraw your consent by writing to the above referred<br />\r\naddress/e-mail of ITX FASHION LIMITED. You can change your preference in respect of<br />\r\nreceiving such communications by logging into the MY ACCOUNT section of this website and<br />\r\nediting your preferences. You can unsubscribe at the Newsletter section.<br />\r\n6. The user (You) hereby guarantees that the personal data provided is true and accurate and<br />\r\nundertakes to notify any change or alteration to the same. Any loss or damage caused to the<br />\r\nwebsite or to the person responsible for the web-site or to any third person through the provision<br />\r\nof erroneous, inexact or incomplete information on the registration forms will be the exclusive<br />\r\nresponsibility of the User.<br />\r\n7. Cookies: We use cookies in this website, small text files with information on your navigation in<br />\r\nthis site whose principal objective is to improve your experience in the website. You can find<br />\r\nfurther information on the cookies that we use, their purpose and other information of interest in<br />\r\nthe section Information on cookies.<br />\r\nBy accepting this privacy policy you consent to the use of the cookies used in this website and<br />\r\nwhich are described on the previously indicated page.<br />\r\nYou may refuse to accept cookies by activating the setting on your browser which allows You to<br />\r\nrefuse the setting of cookies. However, if You select this setting You may be unable to access<br />\r\ncertain parts of the Website or unable to avail of any of our services. Unless You have adjusted<br />\r\nyour browser setting so that it will refuse cookies, our system will issue cookies when You log on<br />\r\nto our site.</p>','no'),(25,'terms_en','<p>Term of use (En)<br />\r\n1. Whenever You use this website, you will be subject to the Privacy Statement in force at all times, and You should review that text in order to check that You are in agreement with it. The provision of your data is voluntary, however, please note that if You do not provide us with the required personal data, we may not be able to provide the information, products or services You need or process your request.<br />\r\n2. Personal data You provide will be kept in a file under the responsibility of ITX FASHION LIMITED (&quot;ITX&quot;) for the purposes of:<br />\r\n1. the performance and enforcement of the purchase and sale contract over the products You have purchased, or of any other contract between You and us; and<br />\r\n2. attending to Your requests.<br />\r\n3. You have the right to access and correct your personal data and request information about our data protection policies and procedures. ITX FASHION LIMITED, with registered address at Hainault House, 5th Floor, 69-71 Stephen&acute;s Green, Dublin 2, Ireland, being in charge of the file, undertakes to keep your personal information confidential and to ensure the exerc